import React from "react";
import "./itemList.css";

const ItemList = props => {
  return (
    <div>
      <ul className="item-list">
        {props.items.map(item => {
          return (
            <figure>
              <img></img>
              <figcaption>
                <div>{this.date}</div>
                <div key={item.id}></div>
                <div>{item.text}</div>
                <div>{item.spend}</div>
              </figcaption>
            </figure>
          );
        })}
      </ul>
    </div>
  );
};

export default ItemList;
